import React from 'react';
import './style.css';

import { VictoryBar, VictoryChart, VictoryTheme } from 'victory';

const sampleData = [
  {x: 1, y: 2},
  {x: 2, y: 5},
  {x: 3, y: 6},
];

class Skills extends React.Component {
  render() {
    return (
      <VictoryChart
        theme={VictoryTheme.material}
        domainPadding={{ x: 10 }}
      >
        <VictoryBar horizontal
          style={{
            data: { fill: "#c43a31" }
          }}
          data={sampleData}
        />
      </VictoryChart>
    )
  }
}

export default Skills;
